import React, { useState } from "react";

const ImNav = () => {
const [inpvalue,setInpvalue] = useState('');
const [serdata,setSerdata] = useState()

  const hamdalechange = ()=>{
    setSerdata(inpvalue)
    alert(serdata)
  }



  return (
    <>
    <h1>{serdata}</h1>
      <div className="Im_nav_baar">
        <div className="Im-name-nave">
          <h1 className="im-name">Shutter Up</h1>
        </div>

        <div className="Im-search-box">
          <input
            className="Im-input"
            type="search"
            placeholder="search images"
            onChange={(d)=>setInpvalue(d.target.value)}
          />
          <i className="fa-solid fa-magnifying-glass search-im-icon" onClick={hamdalechange} ></i>
        </div>

        <div className="Im-hame-menu">
          <i className="fa-solid fa-bars hame-menu-im"></i>
        </div>
        <button className="uploade-img">Uploade</button>
      </div>
    </>
  );
};

export default ImNav;
